import { NavLink, Switch, Route, BrowserRouter } from "react-router-dom";
import React, { useState } from "react";
import TextLoop from "react-text-loop";
import { Component, useEffect } from "react";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faMoneyBillAlt } from '@fortawesome/free-solid-svg-icons'
import './App.css';

function App() {
  const [amount, setAmount] = useState(0)
  const [prompts, setPrompts] = useState([])

  return (
    <div className="App">
      <div className="introduction-section">
        <h1> LIFE IN LITERACY </h1>
        <h3> Control your{" "} 
        <TextLoop>
            <span>spending</span>
            <span>saving</span>
            <span>present</span>
            <span className="future-txt">future</span>
        </TextLoop>
        </h3>
      </div>

      <div className="profile-section">
        <ul>
          <li>Current total: $50</li>
          <li>Level: 1</li>
        </ul>
      </div>

        <footer>
          <h8>Made by: <a href="https://github.com/michelleberry">Michelle Berry</a>, <a href="https://github.com/radwin01">Yara Radwan</a>, <a href="https://github.com/mshankar58">Maya Shankar</a>, ______</h8>
        </footer>
        <Main />
        </div>
  );
}

const Play = () => (
<div><h2> Coming Soon </h2></div>
);

const Home = () => (
  <div class="start-section">
  <ul>
    <li>
      <NavLink className="pls" exact activeClassName="current" to="/play">
      <span className="lol"> <span className="icon"><FontAwesomeIcon icon={faMoneyBillAlt}/></span>{" "}START SIMULATION{" "}<span className="icon"><FontAwesomeIcon icon={faMoneyBillAlt}/></span></span>
      </NavLink>
    </li>
      </ul>
      </div>
);


const Main = () => (
  <BrowserRouter>
  <Switch>
    <Route exact path="/" component={Home}></Route>
    <Route exact path="/play" component={Play}></Route>
  </Switch>
  </BrowserRouter>
);

export default App;
